// dnd-spell-cards-app/frontend/src/App.js

import React from 'react';
import './App.css'; // Don't remove this, you'll put your CSS here

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello from React Frontend!</h1>
        <p>This is your D&D Spell Cards App.</p>
      </header>
    </div>
  );
}

export default App;
